import axios from 'axios';
import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useParams } from 'react-router-dom';
import GoogleMap from './ShowMap';
import Swal from 'sweetalert2';

const URI = 'http://localhost:8080/';

const CompShowDeportivos = () => {
    const { userType, RFC_CURP } = useParams();
    const navigate = useNavigate();
    const [deportivos, setDeportivos] = useState([]);
    const [searchTerm, setSearchTerm] = useState('');

    useEffect(() => {
        if (RFC_CURP !== "null") {
            getDeportivoInfoDeEncargado();
        } else {
            getDeportivoInfo();
        }
    }, []);

    const getDeportivoInfo = async () => {
        const res = await axios.get(`${URI}obtenerDeportivos`);
        setDeportivos(res.data);
    };

    const getDeportivoInfoDeEncargado = async () => {
        const res = await axios.get(`${URI}getDeportivoInfoDeEncargado/${RFC_CURP}`);
        setDeportivos(res.data);
    };

    const deleteDeportivoInfo = async (id) => {
        await axios.delete(`${URI}deleteDeportivoInfo/${id}`);
        getDeportivoInfo();
    };

    const toggleAccordion = (idDeportivo) => {
        setExpandedDeportivo(idDeportivo === expandedDeportivo ? null : idDeportivo);
    };

    const [expandedDeportivo, setExpandedDeportivo] = useState(null);

    return (
        <div className="deportivos-accordion">
            {deportivos.map((deportivo) => {
                const direccion = deportivo.direccion || {};
                const canchas = deportivo.canchas || [];
                const encargado = deportivo.encargado || {};
                const horarios = deportivo.horarios || [];
                return (
                    <div key={deportivo.idDeportivo} className="deportivo-card">
                        <div className="accordion-header" onClick={() => toggleAccordion(deportivo.idDeportivo)}>
                            <h2>{deportivo.numero_registro} - {deportivo.nombre}</h2>
                            <span>{expandedDeportivo === deportivo.idDeportivo ? '-' : '+'}</span>
                        </div>
                        {expandedDeportivo === deportivo.idDeportivo && (
                            <div className="accordion-content">
                                <p><strong>Acepta Mascotas:</strong> {deportivo.acepta_mascotas ? 'Sí' : 'No'}</p>
                                <p><strong>Tienda:</strong> {deportivo.tiene_tienda ? 'Sí' : 'No'}</p>
                                <p><strong>Vestidores:</strong> {deportivo.tiene_vestidores ? 'Sí' : 'No'}</p>
                                <p><strong>Regaderas:</strong> {deportivo.tiene_regaderas ? 'Sí' : 'No'}</p>
                                <p><strong>Médico:</strong> {deportivo.tiene_medico ? 'Sí' : 'No'}</p>

                                <div className="sub-section">
                                    <h3>Dirección</h3>
                                    <p><strong>Calle:</strong> {direccion.calle}</p>
                                    <p><strong>Alcaldía:</strong> {direccion.alcaldia}</p>
                                    <p><strong>Código Postal:</strong> {direccion.codigoPostal}</p>
                                    <p><strong>Coordenadas:</strong> {direccion.coords}</p>
                                </div>

                                <div className="sub-section">
                                    <h3>Encargado</h3>
                                    <p><strong>Nombre:</strong> {encargado.nombre}</p>
                                    <p><strong>Primer Apellido:</strong> {encargado.primerApellido}</p>
                                    <p><strong>Teléfono Móvil:</strong> {encargado.telefonoMovil}</p>
                                    <p><strong>RFC:</strong> {encargado.rfcCurp}</p>
                                </div>

                                <div className="sub-section">
                                    <h3>Canchas</h3>
                                    {canchas.map((cancha) => (
                                        <div key={cancha.id_cancha}>
                                            <p><strong>Tipo:</strong> {cancha.tipo_cancha}</p>
                                            <p><strong>Número:</strong> {cancha.numero_cancha}</p>
                                            <p><strong>Capacidad:</strong> {cancha.capacidad_jugadores}</p>
                                            <p><strong>Estado:</strong> {cancha.estado}</p>
                                        </div>
                                    ))}
                                </div>

                                <div className="sub-section">
                                    <h3>Horarios</h3>
                                    {horarios.map((horario) => (
                                        <div key={horario.idHorario}>
                                            <p><strong>Día:</strong> {horario.diaSemana}</p>
                                            <p><strong>Hora Apertura:</strong> {horario.horaApertura}</p>
                                            <p><strong>Hora Cierre:</strong> {horario.horaCierre}</p>
                                        </div>
                                    ))}
                                </div>
                            </div>
                        )}
                    </div>
                );
            })}
        </div>
    );
};

export default CompShowDeportivos;
